import React from "react";
import {
  XYPlot,
  XAxis,
  YAxis,
  HorizontalGridLines,
  VerticalBarSeries,
  ChartLabel,
} from "react-vis";

function Studentpage(props) {
  // console.log(props)
  const name = props.match.params.name;
  const funFactorData = [{x:0, y:1}]
  const difficultyData = [{xL}]
  return (
    <div className="Chart">
      <XYPlot height={400} width={1350}>
        <HorizontalGridLines />
        <VerticalBarSeries
          className="funfactor"
          color="#c99da3"
          data={funFactorData}
        />
        <VerticalBarSeries className="difficulty" data={difficultyData} />
        <XAxis />
        <YAxis className="funfactor" />
        <YAxis className="difficulty" />
        <ChartLabel
          text="Assignments"
          className="alt-x-label"
          includeMargin={false}
          xPercent={0.025}
          yPercent={1.01}
        />

        <ChartLabel
          text="Funfactor & difficulty"
          className="alt-y-label"
          includeMargin={false}
          xPercent={0.06}
          yPercent={0.06}
          style={{
            transform: "rotate(-90)",
            textAnchor: "end",
          }}
        />
      </XYPlot>

      <form>
        <label>
          <input
            onChange={this.handleChange}
            id="fun"
            type="checkbox"
            name="data"
            value="funfactor"
          />{" "}
          Funfactor per assignment
        </label>
        <label>
          <input
            onChange={this.handleChange}
            id="difficulty"
            type="checkbox"
            name="data"
            value="difficulty"
          />{" "}
          Difficulty per assignment
        </label>
      </form>
      <h1>{`Naam van student ${name}`}</h1>
    </div>
  );
}

export default Studentpage;
